import PropTypes from 'prop-types';

export default function Text_area(props) {


  return (
    <>
        <h4 className='colorw'>{props.heading}</h4>

<textarea rows="3" cols="50">

</textarea>
<textarea rows="1" cols="50"></textarea>

{props.text1!==""?<button> {props.text1}</button>
:<></>}

{props.text2!==""?<button> {props.text2}</button>
:<></>}

{props.text3!==""?<button> {props.text3}</button>
:<></>}

{props.text4!==undefined?<button> {props.text4}</button>
:<></>}


    </>
  )
}
